import styles from './Pedidos.module.css'

import CardPedido from '../../components/cardpedido/CardPedido'
import MenuPerfil from '../../components/menu/MenuPerfil'

//hooks
import { useState, useEffect } from 'react'
import { Link } from 'react-router-dom' 
import { useAuth } from '../../hooks/useAuth'

const Pedidos = () => {

  const {auth} = useAuth()

  const pedidos = {
      id: 1,
      url: "https://www.nicepng.com/png/full/933-9332131_profile-picture-default-png.png",
      username: "Alexandre",
      local: "Canoas, RS",
      tipos: ["A+", "B-", "O-"],
      desc: "Preciso sangue aaaa"
  }

  return (
    <>
    {!auth && (
      <>
        <header className={styles.header}>
          <Link to='/login' className='btn_global'>Novo pedido</Link>
        </header>
      </>
    )
    }
    <div className={styles.container}>
      {auth && (
        <>
          <MenuPerfil />
        </>
      )}
      <div className={styles.pedidos}>  
        <CardPedido 
          id={pedidos.id}
          url={pedidos.url}
          username={pedidos.username}
          local={pedidos.local}
          tipos={pedidos.tipos}
          desc={pedidos.desc}
        />
        <CardPedido 
          id={pedidos.id}
          url={pedidos.url}
          username={pedidos.username}
          local={pedidos.local}
          tipos={pedidos.tipos}
          desc={pedidos.desc}
        />
        <CardPedido 
          id={pedidos.id}
          url={pedidos.url}
          username={pedidos.username}
          local={pedidos.local}
          tipos={pedidos.tipos}
          desc={pedidos.desc}
        />
        <CardPedido 
          id={pedidos.id}
          url={pedidos.url}
          username={pedidos.username}
          local={pedidos.local}
          tipos={pedidos.tipos}
          desc={pedidos.desc}
        />
        <CardPedido 
          id={pedidos.id}
          url={pedidos.url}
          username={pedidos.username}
          local={pedidos.local}
          tipos={pedidos.tipos}
          desc={pedidos.desc}
        />
      </div>
    </div>
  </>
  )
}
export default Pedidos
